import { EXPLORE_SVG, HOME_SVG, NOTIFICATIONS_SVG, MESSAGES_SVG, BOOKMARKS_SVG } from './images'
import './styles.css'
export default function SideMenu() {
    const menu = [
        {
            icon: HOME_SVG,
            name: 'Home'
        },
        {
            icon: EXPLORE_SVG,
            name: 'Explore'
        },
        {
            icon: NOTIFICATIONS_SVG,
            name: 'Notifications'
        },
        {
            icon: MESSAGES_SVG,
            name: 'Messages'
        },
        {
            icon: BOOKMARKS_SVG,
            name: 'Bookmarks'
        },
    ]

    return (
        <div className="w-25 mt-3 mx-5">
        <img src={require('./images/Twitter-logo.png')} className="logo-icon" />

        {menu.map((item, index)=> (<div className='d-flex'>
            <div style={{width: 30, height: 30}}>
                {item.item}
            </div>
            <p className='mx-3' style={{fontSize: 18}}>{item.name}</p>
        </div>))}


        </div>
    )

}
